public Resource getResources() {
  ResourceSizingProtoOrBuilder p = viaProto ? proto : builder;
  if (this.resources != null) {
    return this.resources;
  }
  if (!p.hasResources()) {
    return null;
  }
  this.resources = convertFromProtoFormat(p.getResources());
  return this.resources;
}
